"_HOMEPAGE_CONTENT_" => "{GROUP(groups=Admins)}\n!Děkujeme za instalaci !\n\nCelá komunita uživatelů a vývojářů tohoto systému pro správu obsahu Vás vítá ve světě Tiki. Rádi Vám pomůžeme s prvními krůčky a poradíme jak Tiki používat.\n\n!Jak začít\nJelikož má Tiki víc než 1000 funkcí a možností nastavení, můžete s tímto systémem vytvářet jak jednoduché tak i velice složité weby.\n\nChápeme, že tolik možností, kolik Tiki nabízí v jednom systému může vypadat na první pohled pro správce webu jako \"příliš velké sousto\". Proto Vám nabízíme dvě různé cesty __jak začít__ s Tiki.\n\n{DIV(width=\"48%\",float=\"right\")}\n-=Ruční nastavení pomocí administračního panelu=-\n!![tiki-admin.php|Začněte pomocí Admin panelu]\n__Pro koho je tato možnost určena__\n*Už znáte podobné administrační panely z jiného softwaru\n*Rádi si hrajete a prozkoumáváte více možností nastavení\n*Znáte už Tiki z dřívější doby\n\n{DIV}{DIV(width=\"48%\",float=\"left\")}\n-=Jednoduché nastavení pomocí předdefinovaných profilů=-\n!![tiki-admin.php?profile=&categories%5B%5D=5.x&categories%5B%5D=Featured+profiles&repository=http%3a%2f%2fprofiles.tikiwiki.org%2fprofiles&page=profiles&preloadlist=y&list=List#step2|Začněte pomocí Tiki profilu]\n__Pro koho je tato možnost__\n*Chcete začít rychle\n*Zrovna se necítíte na prozkoumávání všech možností Administračního panelu\n*Chcete rychle otestovat některé z možností, které Tiki nabízí\n\n!!Doporučené profily\n\n__Komunitní web__ ([tiki-admin.php?profile=&categories%5B%5D=5.x&categories%5B%5D=Featured+profiles&repository=http%3a%2f%2fprofiles.tikiwiki.org%2fprofiles&page=profiles&preloadlist=y&list=List#step2|aplikuj tento profil])\nNastaví Tiki tak, aby pomohlo začít více lidem spolupracovat na nějakém projektu či dokumentaci a vytvořit kolektivní databázi znalostí. Obsahuje nastavení pro\n*Editaci Wiki stránek\n*Osobní prostor pro uživatele\n*Diskuzní fóra\n*Blogy\n\n__Osobní Blog a profil uživatele__ ([tiki-admin.php?profile=&categories%5B%5D=5.x&categories%5B%5D=Featured+profiles&repository=http%3a%2f%2fprofiles.tikiwiki.org%2fprofiles&page=profiles&preloadlist=y&list=List#step2|aplikuj tento profil])\nNastavení mnoha \"cool\" vychytávek, které Vám pomohou integrovat funkce tzv. sociálních sítí a vytvořit si silnou pozici v \"blogosféře\". \n*Blog (Plné nastavení všech možností a funkcí týkajících se blogování)\n*Galerie obrázků\n*Kalendář\n*RSS integrace\n*Video Log\n\n__Firemní Intranet__ ([tiki-admin.php?profile=&categories%5B%5D=5.x&categories%5B%5D=Featured+profiles&repository=http%3a%2f%2fprofiles.tikiwiki.org%2fprofiles&page=profiles&preloadlist=y&list=List#step2|aplikuj tento profil])\nNastavení vhodné pro Intranet společnosti typické pro středně velké podnikání.\n*Firemní novinky\n*Blog představenstva\n*Úložiště souborů/dokumentů a management\n*Pracovní Wiki\n\n__Webová prezentace pro malou organizaci__ ([tiki-admin.php?profile=&categories%5B%5D=5.x&categories%5B%5D=Featured+profiles&repository=http%3a%2f%2fprofiles.tikiwiki.org%2fprofiles&page=profiles&preloadlist=y&list=List#step2|aplikuj tento profil])\nNastavení vhodné pro webovou prezentaci malé firmy nebo neziskové organizace.\n*Akce & Novinky\n*Důležité produkty a služby\n*Galerie souborů (hodí se výborně např. pro \"Media Kit\")\n*Kontaktní formulář\n\n{DIV}{ELSE}\n\n!Blahopřejeme !\nToto je přednastavená úvodní stránka čerstvě nainstalovaného publikačního systému Tiki. Mimo jiné to také znamená, že instalace tohoto systému proběhla úspěšně ! :)\n\nObsah této stránky lze po přihlášení uživatele (pokud je ve skupině s příslušnými právy pro editaci) jednoduše změnit. Pokud Vás zajímají detaily týkající se editace, mrkněte prosím na dokumentaci k [http://doc.tikiwiki.org/wiki+syntax|wiki syntaxi].\n\n\n!!{img src=pics/icons/star.png alt=\"Star\"} Jak začít ?\nPrvní kroky k nastavení:\n{FANCYLIST()}\n1) Přihlašte se vpravo nahoře jako admin. \n2) V Administraci si můžete zvolit a aplikovat specifické možnosti a nastavení Tiki. \n3) Pokud chcete rychle začít, zvolte si a aplikujte předdefinované Tiki Profily. \n{FANCYLIST}\n\n!!{img src=pics/icons/help.png alt=\"Pomoc\"} Potřebujete s něčím poradit ?\nPro více informací:\n*[http://info.tikiwiki.org/Learn+More|Zjistěte více o projektu Tiki].\n*[http://info.tikiwiki.org/Help+Others|Získejte pomoc], včetně [http://doc.tikiwiki.org|oficiální dokumentace] a [http://www.tikiwiki.org/forums|podpory v diskuzních fórech].\n*[http://info.tikiwiki.org/Join+the+community|Připojte se k Tiki komunitě].\n{GROUP}",
